  false,\n\t\"url\": null,\n\t\"notes\": \"This is the fiscal year 2009 annual narrative
  report for Neal Smith National Wildlife Refuge.  The report begins with information
  about monitoring and studies which includes bison and elk surveys, various bird
  surveys, a survey of floristic quality, a frog/toad survey, and a Monarch butterfly
  survey.  Habitat restoration and habitat management projects are also covered; activities
  include seed harvesting, greenhouse work, planting, tree removal, fire management,
  and pest plant control.  Fish and wildlife management are discussed next with emphasis
  on bison roundup.  Coordination activities- including interagency and tribal coordination-
  are outlined, as well as resource protection.  Resource protection activities include
  law enforcement, permitting, and land acquisition.  Information about public education
  and recreation is given including education, school programs, and special events.
  \ Finally, refuge planning and administration are discussed.  Lists of refuge personnel
  and volunteer programs are provided.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
